import React from 'react'
import _ from 'lodash'
const PostRender = (props) => {
  const { results } = props.post
  console.log(results)
  const indi = _.map(results, post => {
    return (
      <div>
        <li key={post.pk}>
          {post.name}
        </li>
      </div>
    )
  })
  return ({ indi })
}

export default PostRender
